INSERT INTO `config` (`config_id`, `title`, `value`) VALUES (221, 'terms', '<p></p>\r\n    \r\n    \r\n      <meta charset=\"utf-8\">\r\n      <meta name=\"viewport\" content=\"width=device-width\">\r\n      <title>Privacy Policy</title>\r\n      <style> body { font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; padding:1em; } </style>\r\n    \r\n    \r\n    <strong>Privacy Policy</strong> <p>\r\n                  Infimovies built the Infimovies app as\r\n                  an Ad Supported app. This SERVICE is provided by\r\n                  Infimovies  at no cost and is intended for use as\r\n                  is.\r\n                </p> <p>\r\n                  This page is used to inform visitors regarding our\r\n                  policies with the collection, use, and disclosure of Personal\r\n                  Information if anyone decided to use our Service.\r\n                </p> <p>\r\n                  If you choose to use our Service, then you agree to\r\n                  the collection and use of information in relation to this\r\n                  policy. The Personal Information that we collect is\r\n                  used for providing and improving the Service. We will not use or share your information with\r\n                  anyone except as described in this Privacy Policy.\r\n                </p> <p>\r\n                  The terms used in this Privacy Policy have the same meanings\r\n                  as in our Terms and Conditions, which is accessible at\r\n                  Infimovies unless otherwise defined in this Privacy Policy.\r\n                </p> <p><strong>Information Collection and Use</strong></p> <p>\r\n                  For a better experience, while using our Service, we\r\n                  may require you to provide us with certain personally\r\n                  identifiable information. The information that\r\n                  we request will be retained by us and used as described in this privacy policy.\r\n                </p> <div><p>\r\n                    The app does use third party services that may collect\r\n                    information used to identify you.\r\n                  </p> <p>\r\n                    Link to privacy policy of third party service providers used\r\n                    by the app\r\n                  </p> <ul><li><a href=\"https://www.google.com/policies/privacy/\" target=\"_blank\" rel=\"noopener noreferrer\">Google Play Services</a></li><li><a href=\"https://support.google.com/admob/answer/6128543?hl=en\" target=\"_blank\" rel=\"noopener noreferrer\">AdMob</a></li><li><a href=\"https://firebase.google.com/policies/analytics\" target=\"_blank\" rel=\"noopener noreferrer\">Google Analytics for Firebase</a></li><li><a href=\"https://firebase.google.com/support/privacy/\" target=\"_blank\" rel=\"noopener noreferrer\">Firebase Crashlytics</a></li><li><a href=\"https://www.facebook.com/about/privacy/update/printable\" target=\"_blank\" rel=\"noopener noreferrer\">Facebook</a></li><li><a href=\"https://policies.google.com/privacy\" target=\"_blank\" rel=\"noopener noreferrer\">Fabric</a></li><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----></ul></div> <p><strong>Log Data</strong></p> <p>\r\n                  We want to inform you that whenever you\r\n                  use our Service, in a case of an error in the app\r\n                  we collect data and information (through third party\r\n                  products) on your phone called Log Data. This Log Data may\r\n                  include information such as your device Internet Protocol\r\n                  (“IP”) address, device name, operating system version, the\r\n                  configuration of the app when utilizing our Service,\r\n                  the time and date of your use of the Service, and other\r\n                  statistics.\r\n                </p> <p><strong>Cookies</strong></p> <p>\r\n                  Cookies are files with a small amount of data that are\r\n                  commonly used as anonymous unique identifiers. These are sent\r\n                  to your browser from the websites that you visit and are\r\n                  stored on your device\'s internal memory.\r\n                </p>  <p> This Service does not use these “cookies” explicitly. However,\r\n                  the app may use third party code and libraries that use\r\n                  “cookies” to collect information and improve their services.\r\n                  You have the option to either accept or refuse these cookies\r\n                  and know when a cookie is being sent to your device. If you\r\n                  choose to refuse our cookies, you may not be able to use some\r\n                  portions of this Service.\r\n                </p> <p><strong>Service Providers</strong></p> <p>\r\n                  We may employ third-party companies and\r\n                  individuals due to the following reasons:\r\n                </p> <ul><li>To facilitate our Service;</li> <li>To provide the Service on our behalf;</li> <li>To perform Service-related services; or</li> <li>To assist us in analyzing how our Service is used.</li></ul> <p>\r\n                  We want to inform users of this Service\r\n                  that these third parties have access to your Personal\r\n                  Information. The reason is to perform the tasks assigned to\r\n                  them on our behalf. However, they are obligated not to\r\n                  disclose or use the information for any other purpose.\r\n                </p> <p><strong>Security</strong></p> <p>\r\n                  We value your trust in providing us your\r\n                  Personal Information, thus we are striving to use commercially\r\n                  acceptable means of protecting it. But remember that no method\r\n                  of transmission over the internet, or method of electr